import React from 'react';
import InputMask from 'react-input-mask'

const MaskedInput = ({value, onChange}) =>{
    
    return(
    <InputMask mask='063.088.223-10' 
    value={value} 
    onChange={onChange}
    />
 );
};

export default MaskedInput;
